		"text": "\"김목인은 2000년대 이후 한국 모던포크의 흐름을 연 음악가라고 생각한다. 그리고 2017년에 발매된 3집 [콜라보 씨의 일일]은 콜라보씨의 하루를 통해 음악가의 일상을 담아 온 스토리텔링을 가장 잘 설명해주는 음악들이 담겨 있다. 은유로 넘치지만 다채롭고 선명한 음악이다. (벨로주/박정용)\""
